import React from 'react'
import "./search.css"

function Search(props){


    const handleChange = event => {
        props.setSearchFilter(event.target.value);
    };

    return(
        <div>
            <input
            className="header-search"
            type="text"
            placeholder="Search"
            value={props.searchFilter}
            onChange={handleChange}
            />
        </div>
    )
}

export default Search
